import { ErrorMessage, Field, Form, Formik } from 'formik';
import React, { useEffect, useState } from 'react';
import { Link } from "react-router-dom";
import { getUser } from '../../Utils/Common';
import { useLocation } from 'react-router-dom';
import '../../Utils/Constants';
import ModalGen from '../../Utils/Modals/ModalGeneric';
import GenericApi from '../../Api/Services/GenericApi';
import Spinner from '../../Utils/Spinner';

function AntecedentesMigracionLista() {

    const [getModalState, setModalState] = useState({ title: "", message: "", show: false });
    const [getListaAntecedentes, setListaAntecedentes] = useState({ data: [], links: [], meta: [] });

    const [getAntencedenteAnterior, setAntencedenteAnterior] = useState({ data: [], links: [], meta: [] });
    const [getAntencedenteActual, setAntencedenteActual] = useState({ data: [], links: [], meta: [] });
   
    const location = useLocation()
    const { from } = location.state


    useEffect(() => {
        async function fetchData() {
            window.showSpinner(true);
            listaAntecedentes();
            
           
        }
        fetchData();
    }, []);


    const listaAntecedentes= () => {
        try {

            //buscamos el parametro
            GenericApi.getGeneric("migracion-lista-antecedentes/308232/1/1",).then(
                datos => {

                    if (!datos.error) {
                        setListaAntecedentes(datos);
                        setAntencedenteAnterior(datos.data.attributes.antecedente_anterior);
                        setAntencedenteActual(datos.data.attributes.antecedente_actual)
                    } else {
                        setModalState({ title: "Antecedentes", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', from: {from}, alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                    window.showSpinner(false);
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }


    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <div className="w2d_block">
                <nav aria-label="breadcrumb">
                    <ol className="breadcrumb breadcrumb-alt push">
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                        <li class="breadcrumb-item"> <small>Migraci贸n</small></li>
                    </ol>
                </nav>
            </div>

            <div className="block block-themed">
                <div className="block-header">
                    <h3 className="block-title">Proceso de migraci贸n</h3>
                </div>

                <div className="block-content">

                    {procesoDisciplinario()}
                    
                    <div className="col-md-12">

                        <table class="table">
                            <thead>
                                <tr>
                                    <th scope="col">#</th>
                                    <th scope="col">Fase</th>
                                    <th scope="col">Acciones</th>
                                </tr>
                            </thead>
                            <tbody>
                            <tr>
                                <td>1</td>
                                <td></td>
                                <td><Link className="text-dark" to={`/CargarMigracionAntecedentes`} state={{ from: from }}><small>Completar informaci贸n</small></Link></td>
                            </tr>  

                            <tr>
                                <td>2</td>
                                <td></td>
                                <td><Link className="text-dark" to={`/CargarMigracionAntecedentes`} state={{ from: from }}><small>Completar informaci贸n</small></Link></td>
                            </tr>   

                            </tbody>
                        </table>
                        
                    </div>
                </div>
                
            </div>

                   
        </>
    );
}


export default AntecedentesMigracionLista;
